;; **
;;; # Generate data files for Wicket
;; **

;; @@
; All output for the following code with appear in your "yourdirname" directory. In these experiments "yourdirname" = "gor".

(make-tbls "done" "data1" "wicket" 100)                 ; make train and test data for WPP experiments.
(make-cross-tbls "done" "data1" "ambari" "wicket" 100)  ; make train and test data for TPP experiments using "ambari" = source.
(make-farsec-tbls "done" "ambari" "wicket" true)        ; make train and test data for WPPx experiments.
(make-farsec-tbls "done" "ambari" "wicket" false)       ; make train and test data for TPPx experiments.
(make-pop-tbls "done" "wicket" 100)                     ; make table of keywords and tf-idf values.
(make-predictions "done" "ambari" "wicket" "wpp")       ; make table of prediction results
(make-predictions "done" "ambari" "wicket" "tpp")
(make-predictions "done" "ambari" "wicket" "wppx")
(make-predictions "done" "ambari" "wicket" "tppx")
   
