;; **
;;; # Cumulative Mean Average Precision for Wicket
;; **

;; @@
; Find MAPs for wpp and wppx
(defn wicket-within-map [resdir target]
  (->> 
  [(run-experiment-3e 
   	(str my-home "/"resdir"/"target"-mat-train.csv")
   	(str my-home "/"resdir"/"target"-farsec-train.csv") 
   	(str my-home "/"resdir"/"target"-mat-test.csv")
   	(str my-home "/"resdir"/"target"-farsec-test.csv") 
   	(str my-home "/"resdir"/"target"-matid-test.csv")
   	(str my-home "/"resdir"/"target"-farsecid-test.csv") 
   	(str my-home "/"resdir"/"target"-mat-train.csv") 
   	logistic-regression)
   (run-experiment-3b
    (str my-home "/"resdir"/"target"-mat-train.csv") 
    (str my-home "/"resdir"/"target"-mat-test.csv") 
    (str my-home "/"resdir"/"target"-matid-test.csv") 
    logistic-regression)
   (run-experiment-3b
   	(str my-home "/"resdir"/"target"-mat-train.csv") 
   	(str my-home "/"resdir"/"target"-mat-test.csv") 
   	(str my-home "/"resdir"/"target"-matid-test.csv") 
   	multilayer-perceptron)
   (run-experiment-3e
   	(str my-home "/"resdir"/"target"-mat-train.csv")
   	(str my-home "/"resdir"/"target"-farsec-train.csv") 
   	(str my-home "/"resdir"/"target"-mat-test.csv")
   	(str my-home "/"resdir"/"target"-farsec-test.csv")
   	(str my-home "/"resdir"/"target"-matid-test.csv")
   	(str my-home "/"resdir"/"target"-farsecid-test.csv") 
   	(str my-home "/"resdir"/"target"-mat-train.csv") 
   	multilayer-perceptron)
   (run-experiment-3a 
   	(str my-home "/"resdir"/"target"-matid-test.csv"))]
    (transpose)
    (matrix)))

